import React, { Component } from "react";
import { Breadcrumb, Icon, Row, Col, Layout, Card, Carousel, Input, Button, Divider } from "antd";
import { fetchProfiles } from "../../redux/actions/dashboardAction";
import { connect } from "react-redux";
// import "../../static/css/style.scss";
class Dashboard extends Component {
  state = {
    data: [
      { author: "Pete Hunt", text: "This is one comment" },
      { author: "Jordan Walke", text: "This is *another* comment" }
    ]
  };

  componentDidMount() {
    this.props.fetchProfiles();
  }
  displayList = data => {
    console.log("your data is from api.....", data.users);
    console.log("your data is from state###########", this.state.data);
    const list =
      data.users &&
      data.users.map((item, index) => (
        <Col md={12} key={item._id}>
          <p>aaaa</p>
        </Col>
      ));
    return list;
  };
  render() {
    const { users } = this.props;
    return (
      <Layout>
        <Row>
          <Col span={8} md={8} xs={24}>
            Dashboard
          </Col>
          <Col span={12} md={12} xs={24}>
            <Row>{this.props.users && this.displayList(users)}</Row>
          </Col>
          <Col span={4} md={4} xs={24}>
            Dashboard
          </Col>
        </Row>
      </Layout>
    );
  }
}
const mapStateToProps = state => {
  return {
    users: state.profiles
  };
};
function mapDispatchToProps(dispatch) {
  return {
    fetchProfiles: data => {
      dispatch(fetchProfiles(data));
    }
  };
}
export default connect(mapStateToProps, mapDispatchToProps)(Dashboard);
